databaseVersion.create:
CREATE TABLE DatabaseVersion ( dbVersionId INTEGER PRIMARY KEY ASC AUTOINCREMENT NOT NULL, dbActive BOOLEAN NOT NULL, dbDateReleased DateTime NOT NULL, dbDateUpdated DateTime NOT NULL ); CREATE TABLE Category ( categoryId INTEGER PRIMARY KEY ASC AUTOINCREMENT NOT NULL, categoryName VARCHAR(20) NOT NULL );
CREATE TABLE Ding ( dingId INTEGER PRIMARY KEY ASC AUTOINCREMENT NOT NULL, loc_lat REAL NOT NULL, loc_long REAL NOT NULL, found BOOLEAN NOT NULL, unfoundTitle INTEGER REFERENCES Title(titleId) NOT NULL, foundTitle INTEGER REFERENCES Title(titleId) NOT NULL, url VARCHAR(225) NOT NULL, photographer VARCHAR(255) NOT NULL, circa INTEGER(4) NOT NULL, datefound VARCHAR(30) );
CREATE TABLE Course ( courseId INTEGER PRIMARY KEY ASC AUTOINCREMENT NOT NULL, categoryId INTEGER REFERENCES Category(categoryID) NOT NULL, courseName VARCHAR(40) NOT NULL, description VARCHAR(255) NOT NULL
);
CREATE TABLE CourseLocation ( courseId INTEGER REFERENCES Course(courseID) NOT NULL, DingId INTEGER REFERENCES Ding(dingID) NOT NULL, orderNumber INTEGER NOT NULL );
CREATE TABLE Title ( titleId INTEGER PRIMARY KEY ASC AUTOINCREMENT NOT NULL, title VARCHAR(50) NOT NULL, description VARCHAR(255) NOT NULL );

